import { useState } from "react";
function App() {
  let [num, setName] = useState(0);
  let increaseBtn = () => {
    setName(num + 1);
  };
  return (
    <>
      <h1>{num}</h1>
      <button onClick={increaseBtn}>click</button>
    </>
  );
}

export default App;
